import React from 'react';
import ReactDOM from 'react-dom';
import '../src/App.css';
import App from './App';
<style>
@import url('https://fonts.googleapis.com/css2?family=Jost:wght@400;500;600;700;800;900&display=swap');
</style>



ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
